// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "./SpectrumToken.sol";
import "./SpectrumTokenManager.sol";
import "./SpectrumProviderManager.sol";
import "./SpectrumRentalManager.sol";

contract SpectrumMarketplace is IERC1155Receiver, ERC165, Ownable(msg.sender), Pausable {
    SpectrumToken public spectrumToken;
    SpectrumTokenManager public tokenManager;
    SpectrumProviderManager public providerManager;
    SpectrumRentalManager public rentalManager;

    event SpectrumListed(address indexed provider, uint256 indexed spectrumId, uint256 amount, uint256 ratePerHour);
    event SpectrumRented(address indexed tenant, uint256[] spectrumIds, uint256[] amounts, uint256 rentalDuration);
    event SpectrumReturned(address indexed tenant, uint256[] spectrumIds, uint256[] amounts);
    event RentalExpanded(address indexed tenant, uint256[] spectrumIds, uint256[] amounts);

    constructor(
        address _spectrumToken,
        address _tokenManager,
        address _providerManager,
        address _rentalManager
    ) {
        require(_spectrumToken != address(0), "Invalid spectrum token address");
        require(_tokenManager != address(0), "Invalid token manager address");
        require(_providerManager != address(0), "Invalid provider manager address");
        require(_rentalManager != address(0), "Invalid rental manager address");

        spectrumToken = SpectrumToken(_spectrumToken);
        tokenManager = SpectrumTokenManager(_tokenManager);
        providerManager = SpectrumProviderManager(_providerManager);
        rentalManager = SpectrumRentalManager(_rentalManager);
    }

    /**
     * @dev Provedores listam espectro com uma quantidade específica e taxa.
     */
    function listSpectrum(uint256 spectrumId, uint256 amount, uint256 ratePerHour) external whenNotPaused {
        require(amount > 0, "Amount must be greater than zero");
        require(ratePerHour > 0, "Rate per hour must be greater than zero");

        // Verifica se o provedor aprovou o marketplace para transferir tokens em seu nome.
        require(
            spectrumToken.isApprovedForAll(msg.sender, address(this)),
            "Marketplace not approved"
        );

        // 1. Transfere os tokens do provedor para este contrato.
        spectrumToken.safeTransferFrom(msg.sender, address(this), spectrumId, amount, "");

        // 2. Aprova o contrato tokenManager para movimentar
        if (!spectrumToken.isApprovedForAll(address(this), address(tokenManager))) {
            spectrumToken.setApprovalForAll(address(tokenManager), true);
        }

        require(
            spectrumToken.isApprovedForAll(address(this), address(tokenManager)),
            "TokenManager not approved"
        );

        // O provedor fornece os tokens ao providerManager
        tokenManager.receiveTokensFromProvider(msg.sender, spectrumId, amount);

        // O provedor é armazenado no providerManager
        providerManager.provideTokens(msg.sender, spectrumId, amount, ratePerHour);

        emit SpectrumListed(msg.sender, spectrumId, amount, ratePerHour);
    }

    /**
     * @dev Solicitação de aluguel de espectro.
     */
    function rentSpectrum(
        uint256[] calldata spectrumIds,
        uint256[] calldata amounts,
        uint256 balance
    ) external payable whenNotPaused {
        require(msg.value == balance, "Incorrect balance sent");

        // Aluguel é gerenciado pelo rentalManager
        rentalManager.requestSpectrum(msg.sender, spectrumIds, amounts, balance);

        emit SpectrumRented(msg.sender, spectrumIds, amounts, balance);
    }

    /**
     * @dev Função para devolução do espectro.
     */
    function returnSpectrum(uint256[] calldata spectrumIds, uint256[] calldata amounts) external whenNotPaused {

        // Verifica se o tenant aprovou o marketplace para transferir tokens em seu nome.
        require(
            spectrumToken.isApprovedForAll(msg.sender, address(this)),
            "Marketplace not approved"
        );

        // 1. Transfere os tokens do tenant para este contrato (Marketplace).
        // Aqui, você transfere os tokens de volta para o Marketplace
        for (uint256 i = 0; i < spectrumIds.length; i++) {
            uint256 spectrumId = spectrumIds[i];
            uint256 amount = amounts[i];

            // Realiza a transferência de tokens do tenant para o contrato Marketplace
            spectrumToken.safeTransferFrom(msg.sender, address(this), spectrumId, amount, "");
        }

        // O contrato principal (Marketplace) chama o rentalManager para devolver o espectro.
        rentalManager.returnSpectrum(msg.sender, spectrumIds, amounts);

        // 3. Emite um evento para registrar a devolução
        emit SpectrumReturned(msg.sender, spectrumIds, amounts);
    }

    /**
     * @dev Expansão do aluguel atual com mais espectro.
     */
    function expandRental(uint256[] calldata spectrumIds, uint256[] calldata amounts) external whenNotPaused {
        rentalManager.expandRental(msg.sender, spectrumIds, amounts);

        emit RentalExpanded(msg.sender, spectrumIds, amounts);
    }

    /**
     * @dev Pausa o contrato em caso de emergência
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Despausa o contrato
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    // Função para receber transferências de tokens ERC1155
    function onERC1155Received(
        address /* operator */,
        address /* from */,
        uint256 /* id */,
        uint256 /* value */,
        bytes calldata /* data */
    ) external pure override returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    // Função para receber transferências em lote de tokens ERC1155
    function onERC1155BatchReceived(
        address /* operator */,
        address /* from */,
        uint256[] calldata /* ids */,
        uint256[] calldata /* values */,
        bytes calldata /* data */
    ) external pure override returns (bytes4) {
        return this.onERC1155BatchReceived.selector;
    }

    // Função que verifica suporte à interface
    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns (bool) {
        return interfaceId == type(IERC1155Receiver).interfaceId || super.supportsInterface(interfaceId);
    }
}

contracts/SpectrumProviderManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./SpectrumTokenManager.sol"; // Importando o contrato de custódia

contract SpectrumProviderManager is Ownable(msg.sender) {
    SpectrumTokenManager public tokenManager;

    // Mapeamento para acompanhar a taxa de aluguel (em wei por MHz por hora) para cada provedor e spectrumId
    mapping(address => mapping(uint256 => uint256)) public providerRates; // provider => spectrumId => ratePerHour

    // Mapeamento para acompanhar a quantidade disponível de cada spectrumId fornecida por cada provedor
    mapping(address => mapping(uint256 => uint256)) public providerTokenBalances; // provider => spectrumId => availableAmount

    // Lista de provedores ordenada por taxa para cada spectrumId
    mapping(uint256 => address[]) public spectrumProviders; // spectrumId => ordered list of providers
    mapping(uint256 => mapping(address => bool)) private isProviderListed;

    // Eventos
    event SpectrumProvided(address indexed provider, uint256 indexed spectrumId, uint256 amount, uint256 ratePerHour);

    constructor(address tokenManagerAddress) {
        tokenManager = SpectrumTokenManager(tokenManagerAddress);
    }


    // Função para retornar o comprimento do array de provedores para um spectrumId específico
    function getProviderCount(uint256 spectrumId) external view returns (uint256) {
        return spectrumProviders[spectrumId].length;
    }

    // Função para obter um provedor específico por índice para um spectrumId
    function getProviderByIndex(uint256 spectrumId, uint256 index) external view returns (address) {
        require(index < spectrumProviders[spectrumId].length, "Index out of bounds");
        return spectrumProviders[spectrumId][index];
    }

    /**
     * @dev Função para provedores adicionarem tokens ao marketplace e definir o preço por hora (ratePerHour)
     */
    function provideTokens(address provider, uint256 spectrumId, uint256 amount, uint256 ratePerHour) external {
        require(amount > 0, "Amount must be greater than zero");
        require(ratePerHour > 0, "Rate per hour must be greater than zero");

        // Atualizar o saldo e a taxa para esse provider
        providerTokenBalances[provider][spectrumId] += amount;
        providerRates[provider][spectrumId] = ratePerHour;

        // Adicionar o provedor à lista ordenada por taxa para esse spectrumId
        _addProvider(spectrumId, provider, ratePerHour);

        emit SpectrumProvided(provider, spectrumId, amount, ratePerHour);
    }

    /**
     * @dev Função para adicionar o provedor na lista de provedores ordenada por preço
     */
    function _addProvider(uint256 spectrumId, address provider, uint256 ratePerHour) internal {
        if (!isProviderListed[spectrumId][provider]) {
            address[] storage providers = spectrumProviders[spectrumId];
            uint256 i = 0;

            // Encontre a posição onde o provedor deve ser inserido com base no preço
            while (i < providers.length && providerRates[providers[i]][spectrumId] < ratePerHour) {
                i++;
            }

            // Inserir o provedor na lista de forma ordenada
            providers.push(provider);
            for (uint256 j = providers.length - 1; j > i; j--) {
                providers[j] = providers[j - 1];
            }
            providers[i] = provider;

            // Marcar que esse provedor já está listado para o spectrumId
            isProviderListed[spectrumId][provider] = true;
        }
    }

    /**
     * @dev Função para encontrar o provedor que oferece a melhor taxa (mais baixa) para o espectro e quantidade solicitada.
     */
    function findBestProvider(uint256 spectrumId, uint256 amountNeeded) external view returns (address) {
        // Loop pela lista ordenada de provedores para o spectrumId
        for (uint256 i = 0; i < spectrumProviders[spectrumId].length; i++) {
            address provider = spectrumProviders[spectrumId][i];
            uint256 availableAmount = providerTokenBalances[provider][spectrumId];

            // Verifique se o provedor tem espectro suficiente disponível
            if (availableAmount >= amountNeeded) {
                return provider;
            }
        }

        revert("No provider found with sufficient spectrum for this request");
    }

    /**
     * @dev Atualiza o saldo de um provedor específico após uma alocação de espectro.
     * @param spectrumId O ID do espectro solicitado.
     * @param provider O endereço do provedor que forneceu o espectro.
     * @param allocatedAmount A quantidade de espectro alocada desse provedor.
     */
    function updateProviderBalance(
        address provider,
        uint256 spectrumId,
        uint256 allocatedAmount
    ) external {
        require(provider != address(0), "Invalid provider address");
        require(providerTokenBalances[provider][spectrumId] >= allocatedAmount, "Insufficient balance for allocation");

        // Reduz o saldo disponível do provedor para o spectrumId específico
        providerTokenBalances[provider][spectrumId] -= allocatedAmount;
    }

}

contracts/SpectrumRentalManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./SpectrumProviderManager.sol";
import "./SpectrumTokenManager.sol";

contract SpectrumRentalManager is Ownable(msg.sender) {
    SpectrumProviderManager public providerManager;
    SpectrumTokenManager public tokenManager;

    struct SpectrumRental {
        address tenant;
        mapping(uint256 => uint256) spectrumAmounts; // spectrumId => quantidade alugada
        uint256[] rentedSpectrumIds;
        uint256 timeAllocated;
        uint256 startTime;
        uint256 endTime;
        uint256 ratePerSecond;
        bool isActive;
        uint256 lastUpdated;
        mapping(uint256 => address[]) providersForSpectrum; // Cada spectrumId pode ter múltiplos provedores
    }

    mapping(address => SpectrumRental) public activeRentals;

    event SpectrumRented(
        address indexed tenant,
        uint256[] spectrumIds,
        uint256[] amounts,
        uint256 timeAllocated
    );
    event SpectrumReturned(
        address indexed tenant,
        uint256[] spectrumIds,
        uint256[] amounts,
        uint256 timeUsed,
        uint256 refund
    );

    constructor(address providerManagerAddress, address tokenManagerAddress) {
        providerManager = SpectrumProviderManager(providerManagerAddress);
        tokenManager = SpectrumTokenManager(tokenManagerAddress);
    }

    function getRentedSpectrumIdByIndex(address tenant, uint256 index)
        external
        view
        returns (uint256)
    {
        require(
            index < activeRentals[tenant].rentedSpectrumIds.length,
            "Index out of bounds"
        );
        return activeRentals[tenant].rentedSpectrumIds[index];
    }

    function getSpectrumAmount(address tenant, uint256 spectrumId)
        external
        view
        returns (uint256)
    {
        return activeRentals[tenant].spectrumAmounts[spectrumId];
    }

    function requestSpectrum(
        address tenant,
        uint256[] calldata spectrumIds,
        uint256[] calldata amounts,
        uint256 balance
    ) external {
        require(
            spectrumIds.length == amounts.length,
            "Spectrum IDs and amounts must match"
        );
        require(spectrumIds.length > 0, "Must request at least one spectrum");

        SpectrumRental storage rental = activeRentals[tenant];
        require(!rental.isActive, "Already active rental");

        uint256 totalRatePerSecond = 0;

        for (uint256 i = 0; i < spectrumIds.length; i++) {
            uint256 spectrumId = spectrumIds[i];
            uint256 amountNeeded = amounts[i];
            uint256 amountAllocated = 0;

            // Adicione o spectrumId ao array rentedSpectrumIds, se ainda não estiver presente
            if (rental.spectrumAmounts[spectrumId] == 0) {
                rental.rentedSpectrumIds.push(spectrumId);
            }

            while (amountAllocated < amountNeeded) {
                address provider = providerManager.findBestProvider(
                    spectrumId,
                    amountNeeded - amountAllocated
                );
                uint256 providerRate = providerManager.providerRates(
                    provider,
                    spectrumId
                );
                uint256 allocatableAmount = providerManager
                    .providerTokenBalances(provider, spectrumId);

                uint256 allocation = allocatableAmount > (amountNeeded - amountAllocated) ? (amountNeeded - amountAllocated): allocatableAmount;

                providerManager.updateProviderBalance(
                    provider,
                    spectrumId,
                    allocation
                );
                rental.spectrumAmounts[spectrumId] += allocation;
                rental.providersForSpectrum[spectrumId].push(provider);

                // Convert rate from per hour to per second
                totalRatePerSecond += (providerRate * allocation) / 3600;
                amountAllocated += allocation;
            }
        }

        // Prevent division by zero
        require(totalRatePerSecond > 0, "No valid providers found");

        uint256 totalRentalTime = balance / totalRatePerSecond;
        rental.tenant = tenant;
        rental.timeAllocated = totalRentalTime;
        rental.startTime = block.timestamp;
        rental.endTime = block.timestamp + totalRentalTime;
        rental.ratePerSecond = totalRatePerSecond;
        rental.isActive = true;
        rental.lastUpdated = block.timestamp;

        // Transferir tokens ao locatário usando o TokenManager
        tokenManager.transferToTenant(tenant, spectrumIds, amounts);

        emit SpectrumRented(tenant, spectrumIds, amounts, totalRentalTime);
    }

    function returnSpectrum(
        address tenant,
        uint256[] calldata spectrumIds,
        uint256[] calldata amounts
    ) external {
        SpectrumRental storage rental = activeRentals[tenant];
        require(rental.isActive, "No active rental");

        uint256 timeUsed = block.timestamp - rental.startTime;
        uint256 ratePerSecondReduction = 0;

        for (uint256 i = 0; i < spectrumIds.length; i++) {
            uint256 spectrumId = spectrumIds[i];
            uint256 amountToReturn = amounts[i];
            require(
                rental.spectrumAmounts[spectrumId] >= amountToReturn,
                "Return amount exceeds rented"
            );

            // Obter provedores do spectrumId
            address[] memory providers = rental.providersForSpectrum[
                spectrumId
            ];

            uint256 remainingAmount = amountToReturn;

            // Caminhar na lista de provedores de trás para frente
            for (
                uint256 j = providers.length;
                j > 0 && remainingAmount > 0;
                j--
            ) {
                address provider = providers[j - 1]; // Ajuste para índices zero-based
                uint256 providerRate = providerManager.providerRates(
                    provider,
                    spectrumId
                );

                uint256 providerAmount = remainingAmount <
                    rental.spectrumAmounts[spectrumId]
                    ? remainingAmount
                    : rental.spectrumAmounts[spectrumId];

                ratePerSecondReduction += (providerRate * providerAmount);

                remainingAmount -= providerAmount;
            }

            rental.spectrumAmounts[spectrumId] -= amountToReturn;
        }

        rental.ratePerSecond -= ratePerSecondReduction;

        if (rental.ratePerSecond == 0) {
            rental.isActive = false;
        } else {
            _recalculateRentalTime(tenant);
        }

        // Transferência dos tokens de volta ao TokenManager
        tokenManager.returnFromTenant(tenant, spectrumIds, amounts);

        emit SpectrumReturned(tenant, spectrumIds, amounts, timeUsed, 0);
    }

    function expandRental(
        address tenant,
        uint256[] calldata spectrumIds,
        uint256[] calldata amounts
    ) external {
        SpectrumRental storage rental = activeRentals[tenant];
        require(rental.isActive, "No active rental");

        uint256 additionalRatePerSecond = 0;

        for (uint256 i = 0; i < spectrumIds.length; i++) {
            uint256 spectrumId = spectrumIds[i];
            uint256 additionalAmountNeeded = amounts[i];
            uint256 amountAllocated = 0;

            while (amountAllocated < additionalAmountNeeded) {
                // Encontrar o provedor mais barato disponível
                address provider = providerManager.findBestProvider(
                    spectrumId,
                    additionalAmountNeeded - amountAllocated
                );
                uint256 providerRate = providerManager.providerRates(
                    provider,
                    spectrumId
                );

                uint256 amountFromProvider = additionalAmountNeeded -
                    amountAllocated;
                // Convert rate from per hour to per second
                uint256 costPerSecond = (providerRate * amountFromProvider) / 3600;

                // Atualizar alocação de espectro e custo do aluguel
                rental.spectrumAmounts[spectrumId] += amountFromProvider;
                rental.providersForSpectrum[spectrumId].push(provider);
                additionalRatePerSecond += costPerSecond;

                amountAllocated += amountFromProvider;
            }
        }

        // Atualizar a taxa de consumo total e recalcular o tempo de locação
        rental.ratePerSecond += additionalRatePerSecond;
        _recalculateRentalTime(tenant);

        emit SpectrumRented(tenant, spectrumIds, amounts, rental.timeAllocated);
    }

    function _recalculateRentalTime(address tenant) internal {
        SpectrumRental storage rental = activeRentals[tenant];
        require(rental.isActive, "No active rental");

        _updateRentalBalance(tenant);

        if (rental.ratePerSecond == 0) {
            rental.isActive = false;
            return;
        }

        // Use tenant's balance instead of contract balance
        uint256 tenantBalance = address(tenant).balance;
        uint256 remainingTime = tenantBalance / rental.ratePerSecond;
        rental.endTime = block.timestamp + remainingTime;
        rental.timeAllocated =
            (block.timestamp - rental.startTime) +
            remainingTime;
    }

    function _updateRentalBalance(address tenant) internal {
        SpectrumRental storage rental = activeRentals[tenant];
        require(rental.isActive, "No active rental");

        uint256 elapsedTime = block.timestamp - rental.lastUpdated;
        uint256 cost = elapsedTime * rental.ratePerSecond;

        require(address(tenant).balance >= cost, "Insufficient balance");

        if (cost > 0 && address(tenant).balance >= cost) {
            rental.lastUpdated = block.timestamp;
        } else {
            rental.isActive = false;
        }
    }
}

